export const fetchData = async (fileName) => {
    try {
      const response = await fetch('/GDDataJSON/' + fileName);
      console.log('/GDDataJSON/' + fileName)
      const jsonData = await response.json();
      return jsonData;
    } catch (error) {
      console.error('Error retrieving data:', error);
      return null;
    }
  };
